import React from 'react';
import { Navbar, Nav, NavDropdown } from 'react-navbar-dropdown';
import 'react-navbar-dropdown/dist/index.css';
import Auth from "../../utils/auth";

const PabloNavbar = () => {
  const handleLogout = () => {
    Auth.logout();
  };

  return (
    <Navbar expand="lg">
      <Navbar.Brand href="/">
        <img
          src={require("../../assets/2.png")}
          alt="logo of pablo honey bikes"
          className="logo"
        />
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="/">Home</Nav.Link>
          <NavDropdown title="SHOP" id="basic-nav-dropdown">
            <NavDropdown.Item href="/category1">Category 1</NavDropdown.Item>
            <NavDropdown.Item href="/category2">Category 2</NavDropdown.Item>
            <NavDropdown.Item href="/category3">Category 3</NavDropdown.Item>
          </NavDropdown>
          <Nav.Link href="/about">About</Nav.Link>
        </Nav>
        <Nav>
          {Auth.loggedIn() ? (
            <>
              <Nav.Link onClick={handleLogout}>Logout</Nav.Link>
            </>
          ) : (
            <>
              <Nav.Link href="/login">Login</Nav.Link>
              <Nav.Link href="/signup">Sign Up</Nav.Link>
            </>
          )}
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default Navbar;
